import React, {Component} from 'react';

class Detail extends Component {
    render() {
        console.log(this.props.match.params)
        const {id,title}=this.props.match.params;
        return (
            <div className="detail">
                {id}  {title}
            </div>
        );
    }
}

export default Detail;
